export const Content1F = () => {
  return (
    <div className="content-0">
      <div className="content-0A">
        <h1> 거래 6</h1>
        <br></br>
        <h3>
          고용보험료, 생명 및 상해보험료, 사회보장세(FICA), 원천징수세를
          납부한다.
        </h3>
        <br></br>
        <p>
          {" "}
          1. 미지급비용 9,690달러를 지급한다.(거래 2: 2,860달러, 거래 5:
          6,830달러). 그리고 현금흐름표의{" "}
          <span style={{ color: "#5400cf" }}>현금지출</span> 항목에 이 금액을
          기록한다.
        </p>
        <p>
          2. 대차대조표의 자산 계정{" "}
          <span style={{ color: "#5400cf" }}>현금</span> 항목에서 해당 금액을
          차감한다.
        </p>
        <p>
          3. 대차대조표의 부채 계정{" "}
          <span style={{ color: "#5400cf" }}>미지급비용</span> 항목에서 위에
          지급한 9,690달러를 차감한다. 이들 비용은 미지급 상태였다.
        </p>
        <p>해당 거래 이후 재무제표에서의 변동 사항을 고르시오.</p>
      </div>
    </div>
  );
};
